import React from 'react';
import ReactPlayer from "react-player";

export default function Testimonials() {
  const piles = [""];
  const kidneyFailure = [""];
  const mind = [""];
  const multipleOrganFailure = [""];
  const autoImmuneDesease = [""];
  const liver = [""];
  const ENT = [""];
  const eye = [""];
  const diabetese = [""];
  const cancer = [""];
  const allVideos = [
    piles,
    kidneyFailure,
    mind,
    multipleOrganFailure,
    autoImmuneDesease,
    liver,
    ENT,
    eye,
    diabetese,
    cancer,
  ];
  const allVideosNames = [
    "Piles",
    "Kidney Failure",
    "Mind",
    "Multiple Organ Failure",
    "Auto Immune Desease",
    "Liver",
    "ENT",
    "Eye",
    "Diabetese",
    "Cancer",
  ];
  return (
    <div>
      {allVideos.map((v, i) => (
        <div>
          <h1 className="text-formate">{allVideosNames[i]}</h1>
          {v.map((video, i) => (
            <ReactPlayer url={video} />
          ))}
        </div>
      ))}
    </div>
  );
}
